import Link from 'next/link'
import Layout from '../components/layout'

export default function Visualizations() {
  return (
    <Layout>
      <Head>
        <title>EEG Visualizations</title>
      </Head>
      <h1>Page for EEG Visualizations</h1>
    </Layout>
  )
}

